    const wrapperRef = useRef(null);
    const gridItem1Ref = useRef(null);
    const gridItem2Ref = useRef(null);
    const gridItem3Ref = useRef(null);
    const titleRef = useRef(null);
    const acquireRef = useRef(null);
    
    useEffect(() => {
      const mm = gsap.matchMedia();
    
      mm.add(
        {
          isDesktop: '(min-width: 768px)',
          isMobile: '(max-width: 767px)',
        },
        (context) => {
          const { isMobile } = context.conditions;
    
          // Skip all animations on mobile
          if (isMobile) return;
    
          // Main wrapper animation (desktop only)
          gsap.fromTo(
            wrapperRef.current,
            { y: 100, opacity: 0 },
            {
              y: 0,
              opacity: 1,
              duration: 1.5,
              ease: 'power3.out',
              scrollTrigger: {
                trigger: wrapperRef.current,
                start: 'top 80%',
                end: 'top 20%',
                scrub: 0.8,
              },
            }
          );
    
          // Title animation (desktop only)
          gsap.fromTo(
            titleRef.current,
            { y: 30, opacity: 0, scale: 0.95 },
            {
              y: 0,
              opacity: 1,
              scale: 1,
              duration: 1,
              ease: 'power2.out',
              scrollTrigger: {
                trigger: titleRef.current,
                start: 'top 85%',
                end: 'top 50%',
                scrub: 0.8,
              },
            }
          );
    
          // Grid items animation (desktop only)
          [gridItem1Ref, gridItem2Ref, gridItem3Ref].forEach((ref, index) => {
            gsap.fromTo(
              ref.current,
              { y: 50, opacity: 0, scale: 0.9 },
              {
                y: 0,
                opacity: 1,
                scale: 1,
                duration: 1,
                delay: index * 0.25,
                ease: 'power3.out',
                scrollTrigger: {
                  trigger: ref.current,
                  start: 'top 80%',
                  end: 'top 30%',
                  scrub: 0.8,
                },
              }
            );
          });
    
          // Acquire CRX section animation (desktop only)
          gsap.fromTo(
            acquireRef.current,
            { y: 50, opacity: 0, scale: 0.95 },
            {
              y: 0,
              opacity: 1,
              scale: 1,
              duration: 1.2,
              ease: 'power3.out',
              scrollTrigger: {
                trigger: acquireRef.current,
                start: 'top 85%',
                end: 'top 40%',
                scrub: 0.8,
              },
            }
          );
        }
      );
    
      return () => mm.revert(); // Cleanup
    }, []);
    
    const itemRefs = useRef([]);
    
    useEffect(() => {
      const mm = gsap.matchMedia();
    
      mm.add(
        {
          isDesktop: '(min-width: 768px)',
          isMobile: '(max-width: 767px)',
        },
        (context) => {
          const { isMobile } = context.conditions;
    
          // Skip animations on mobile
          if (isMobile) return;
    
          // Item animations (desktop only)
          itemRefs.current.forEach((el, index) => {
            if (!el) return;
    
            gsap.fromTo(
              el,
              {
                autoAlpha: 0,
                y: 50,
              },
              {
                autoAlpha: 1,
                y: 0,
                duration: 0.3,
                ease: 'power2.out',
                scrollTrigger: {
                  trigger: el,
                  start: 'top 100%',
                  toggleActions: 'play none none none',
                },
                delay: index * 0.1,
              }
            );
          });
        }
      );
    
      return () => mm.revert(); // Cleanup
    }, []);
